import SearchBar from "../SearchBar/SearchBar";
import { NavLink } from "react-router-dom";
import "./Estilos/Navegador.css";
import RickAndMortyImage from './Imagenes/20220319060843Rick_and_Morty.svg';

function Navegador({buscador}){
return (
    <nav className="Navegador">

        <div className="Izquierda">
            <img src={RickAndMortyImage}/>
        </div>

        <SearchBar className="Centro" buscador={buscador}/>

        <div className="Derecha">
            <NavLink to='/SobreMi'>Sobre Mi</NavLink><br/>
            <NavLink to='/'>Principal</NavLink><br/>
            <NavLink to='/Favoritos'>Favoritos</NavLink><br/>
        </div>
    </nav>
        
    
)}

export default Navegador;
